import React from 'react'
import Headerimg from '../img/header_img.jpg'
import './Header.scss'

function Header() {
  return (
    <div className='header'>
        <h4>APPS Unveils new Studio</h4>
        <h2>Lagom</h2>
        <img className='header__logo' alt = 'logo' src = {Headerimg} />
    </div>
  )
}

export default Header
